import { GET_PLAYERS } from '../actions/types.js';

const initialState = {
  players: [
    { text: "test dare" }
  ]
}

export default function(state = initialState, action) {
  switch(action.type) {
    case GET_DARES:
      return {
        ...state
      };
      default:
        return state;
  }
}
